Closed! Winner is @momrewritten 🎉 
Day 8 of our 25 Days of Christmas Giveaway. You will have the chance to win a Sunset desert ornament! Please make sure to follow ALL instructions below to enter giveaway. 

1. Follow me
2. Like this post
3. What’s one word to best describe the holidays for you?(Please only comment once to make it fair)
4. Show support by liking and commenting on my three past post!

That’s it! You must be 18+ to win giveaway.

Giveaway is open to USA!
(Sorry! No international shipping at this time)

Good luck to everyone!

PLEASE don’t give your credit card info to anyone or accept requests from fake accounts.

Winner will be chosen on December 13.

Remember to Visit and Follow all other Artists previously listed for a Chance at another prize on their individual feeds.

